import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```
## Create a TooltipProvider

Next, we create a TooltipProvider that will be used to wrap the Tooltip component. The TooltipProvider will have a state that will be used to store the currently opened Tooltip. The TooltipProvider will also have a function that will be used to close the currently opened Tooltip.
```
import React from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = React.useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
## Use the TooltipProvider

Next, we use the TooltipProvider to wrap the Tooltip component. The TooltipProvider will have a state that will be used to store the currently opened Tooltip. The TooltipProvider will also have a function that will be used to close the currently opened Tooltip.
```
import React from 'react';
import Tooltip from './Tooltip';
import TooltipProvider from './TooltipProvider';

const App = () => {
  return (
    <TooltipProvider>
      <Tooltip title="Tooltip 1" content="Tooltip 1 content" />
      <Tooltip title="Tooltip 2" content="Tooltip 2 content" />
      <Tooltip title="Tooltip 3" content="Tooltip 3 content" />
    </TooltipProvider>
  );
};

export default App;
```
## Use the TooltipContext

Next, we use the TooltipContext to close the previously opened Tooltip and so on. The TooltipContext will have a state that will be used to store the currently opened Tooltip. The TooltipContext will also have a function that will be used to close the currently opened Tooltip.
```
import React from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ title, content }) => {
